import React from "react";
import Button from "./components/Button";
import { Link } from "react-router-dom";
import * as data from "./data/courses";
import * as data1 from "./data/courses2";

class FinalizeExportSem extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.setCourses = this.setCourses.bind(this);
    this.regEx = this.regEx.bind(this);
    this.regEx2 = this.regEx2.bind(this);
    this.changeSection = this.changeSection.bind(this);

    this.state = {
      show: false,
      show1: false,
      rubiat: false,
      colorS: false,
      isLoading: true,
      lectures: null,
      labs: null,
      tutorials: null,
      dataCourses: null,
      Courses: null,
      coursesFall: null,
      coursesWinter: null,
      coursesSummer: null,
      coursesTaken: null,
      loggedIn: false,
      semester: semester,
      year: year,
      weekdays: ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday"],
      credits: 0,
    }
  }

  componentDidMount() {
    fetch("/semQuery")
        .then(res => res.json())
        .then(users2 => this.setState({ users2 }, () => this.setCourses(users2)))
        .then(() => this.regEx())
  }

  render() {
    return (
      <div className="container">
        <div className="container">
          <div className="jumbotron j-greetings">
            <h1>This is your Finalized Format</h1>
            <hr color="#7E1530" />
            <p>

            </p>
            <hr color="#7E1530" />
            <Link to="/select-semester">
              <Button text="Export as PDF" />
            </Link>
            <Link to="/course-selection-menu">
              <Button text="Back to Course Selection" />
            </Link>
          </div>
        </div>
      </div>
    );
  }
}

export default FinalizeExportSem;
